import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Find a specific product card and click it to open the details modal
    const productCardLocator = page.locator('.product-card:has-text("Sony WH-1000XM5")');
    await productCardLocator.waitFor({ state: 'visible', timeout: 5000 });
    await productCardLocator.click();

    // 2. Wait for the product detail modal to be visible
    await page.waitForSelector('#productModal', { state: 'visible', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_modal.png'));

    // 3. Find and click the "Add to Wish List" button within the modal
    const addToWishlistButton = page.locator('#productModal .add-to-wishlist');
    await addToWishlistButton.waitFor({ state: 'visible', timeout: 5000 });
    await addToWishlistButton.click();

    // 4. Wait for the success notification and capture it
    const notificationLocator = page.locator('div.notification.success');
    await notificationLocator.waitFor({ state: 'visible', timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_wishlist_confirmation.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_wishlist_confirmation.png'));

    // 5. Extract data to verify completion
    const notificationText = await notificationLocator.innerText();

    return {
      success: true,
      action: "Added a product to the wishlist and verified the confirmation message.",
      extractedData: {
        confirmationMessage: notificationText
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Take a screenshot on error
    await page.screenshot({ path: path.join(screenshotsDir, 'error.png') });
    screenshots.push(path.join(screenshotsDir, 'error.png'));

    return {
      success: false,
      action: "Failed to add product to wishlist",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
